import React from "react";
import "./stamp.css";

const StampPads = () => {
  const printers = [
    {
      printer: "Printer C 10",
      size: "10 x 27 mm",
      lines: "3",
      packaging: "Packaging",
      handle: "E/10",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
    },
    {
      printer: "Printer C 20",
      size: "14 x 38 mm",
      lines: "4",
      packaging: "Packaging",
      handle: "E/20",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
    },
    {
      printer: "Printer C 30",
      size: "18 x 47 mm",
      lines: "5",
      packaging: "Packaging",
      handle: "E/30",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
    },
  ];

  const Card = ({ printer, size, lines, packaging, handle, sparePad, optionalCover }) => {
    return (
      <div className="card">
        <div className="card-image">
          <img src={`/${printer.replace(" ", "_")}.png`} alt={printer} />
        </div>
        <div className="card-content">
          <h3>{printer}</h3>
          <p>
            <strong>Size of Imprint:</strong> {size}
          </p>
          <p>
            <strong>Recommended Lines:</strong> {lines}
          </p>
          <p>
            <strong>Packaging:</strong> {packaging}
          </p>
          <p>
            <strong>Colour of Handle:</strong> {handle}
          </p>
          <p>
            <strong>Spare Pad:</strong> {sparePad}
          </p>
          <p>
            <strong>Optional Cover:</strong> {optionalCover}
          </p>
        </div>
      </div>
    );
  };

  return (
    <div className="app">
      {printers.map((printer, index) => (
        <Card key={index} {...printer} />
      ))}
    </div>
  );
};

export default StampPads;
